import React,{Component} from 'react';
import axios from "axios";

class Login extends Component {
    constructor(props){
        super(props);
    }
render() {
    console.log(this.props); 
        return ( <div className="div1">

        <div style={{color : "purple"}}><h1>Login</h1></div>
        <br/>
        <div>

            <img src="data:image/png;base64," alt="Login"/>

        </div>
        <br/><br/>
        <div>

             &emsp;&emsp;
            <input type="email" value={this.props.state.email} onChange={e=>{this.props.onchange_email(e)}} placeholder="Email" required/>
            <br/><br/>&emsp;&emsp;
            <input type="password" value={this.props.state.password} onChange={e=>{this.props.onchange_password(e)}} placeholder="PassWord" required/>
            <br/><br/><br/>
            &emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&nbsp;
            <button onClick={()=>{this.props.onclick_button()}}>Done</button>
            <br/><br/>
           <center><h4 style={{color : '#1843f0',fontWeight : '500'}}>{this.props.state.submissionMessage}</h4></center>
            <br/>
            <div style={{display : "flex",float: "right",justifyContent : "center",alignItems : "center"}}>
               <div>
                   <button onClick={this.props.onclick_button2()} className="button1" style={{fontSize : "10px"}}>Forgot Password</button>
               </div>
               &emsp;&emsp;
               <div>
                    <button onClick={()=>{this.setState({login : false,submissionMessage : ""})}} className="button">SignUp</button>
               </div>
            </div>
        </div>
    </div> );
    }
}

export default Login;
